public static void verbose(Object... args) {
  if (!VERBOSE) return;
  StringBuilder sb = new StringBuilder("###TEST:");
  sb.append(Thread.currentThread().getName());
  sb.append(':');
  for (Object o : args) {
    sb.append(' ');
    sb.append(o.toString());
  }
  log.info(sb.toString());
  // System.out.println(sb.toString());
}

